import { Routes, Route  } from "react-router-dom";
import Home from '../routes/Home';
import About from '../routes/About/About'

const App = () => {
  return (
    <>
      <Routes>
          <Route index element={<Home />} />
          <Route index element={<About />} />
      </Routes>
    </>
  )
}

export default App;
